x=96
y=24

DIRT = 64
ANT=112
BLANK = 255

LIVES = 3
LEVEL=0

--State CODES
INLEVEL = 111
TRYAGAIN = 222
WINSCREEN = 333
LOSESCREEN = 444
RETREATING = 555
START = 666

--TODO
--Reset ants table in initialize() (This is leading to winning prematurely on the second life)
--make the ants grant more time
-- win screen?
-- sound?

dirs={ -- arrow keys effect on head
	[0]={x= 0,y=-1}, --up
	[1]={x= 0,y= 1}, --down
	[2]={x=-1,y= 0}, --left
	[3]={x= 1,y= 0} --right
}

ants={
}

--Initializing Functions

function initTongue()
	tongue={
		{x=14, y=4},
		{x=14, y=5},
		{x=14, y=6}
	}
	dir=dirs[3]
end

function spawnAnts(num)
	while (num > 0) do
		potx = math.random(0, 29)
		poty = math.random(5, 15) -- Below Ardy <3
		if ((mget(potx, poty) ~= DIRT) and (mget(potx, poty) ~= ANT)) then
		--ADD conditional for ants to not overlap on other ants
			table.insert(ants, #ants+1, {x=potx, y=poty})
			num = num - 1
		end
	end
end

function exterminate()
	for i,v in pairs(ants) do
		mset(v.x, v.y, BLANK)
	end

	for i=(#ants),1,-1 do
		table.remove(ants, i)
	end 
	
	NUMANTS=0
end

function initialize()
	exterminate() -- Kills Ants from Remaining Attempts
	t=0
	NUMANTS=12+(LEVEL)
	LEVELTIME=30-(LEVEL*2)
	initTongue()
	spawnAnts(NUMANTS)
	state = INLEVEL
end

-- Updating Functions

function gotFood()
	for i,v in pairs(ants) do
		if((v.x == head.x) and (v.y == head.y)) then
			mset(v.x, v.y, BLANK)
			table.remove(ants, i)
			NUMANTS=NUMANTS-1
			LEVELTIME=LEVELTIME+1
		end
	end
end

function draw()
	--cls(0) --our gifs were recording before we fixed the background, I am so sorry
	cls()	
	map(0,0,31,17)

	for i,v in pairs(tongue) do
		rect(v.x*8,v.y*8,8,8,2)
	end

	--draw ants
	for i,v in pairs(ants) do
		mset(v.x, v.y, ANT)
	end

	--timer line
	line(0, 1, (240-(240*((t/60)/LEVELTIME))), 1, 3)

	--Draw Lives
	if(LIVES<=2) then
		mset(4,1,BLANK)
		mset(5,1,BLANK)
	end
	if (LIVES<=1) then
		mset(2,1,BLANK)
		mset(3,1,BLANK)
	end
	if (LIVES<=0) then
		mset(0,1,BLANK)
		mset(1,1,BLANK)
	end
	
end

function bonk()
	if mget(head.x,head.y)==DIRT then
		retreat()
	end
end

function retreat()
	--delete the head
	table.remove(tongue, #tongue)
	--make the middle a head
	--head = tongue[#tongue]
end

function overlap()
	for i,v in pairs(tongue) do 
		if i~=(#tongue) and v.x==head.x and v.y==head.y then
			state=RETREATING
			--race("YOU LOSE :(")
			--exit()
		end
	end
end

-- Helpers
function update()
	return t%10==0
end

function tongueUpdate()
	head = tongue[#tongue] --head is the highest adderess
	neck = tongue[#tongue-1] -- neck has adress directly after head
	tail = tongue[1]
	overlap() 
	bonk()
	if update() then
		table.insert(tongue,#tongue+1,{x=(head.x+dir.x)%30,y=(head.y+dir.y)%17}) -- adds new head
	end
end

function dirUpdate()
	local last_dir=dir
	
	if btn(0) then dir=dirs[0]
		elseif btn(1) then dir=dirs[1]
		elseif btn(2) then dir=dirs[2]
		elseif btn(3) then dir=dirs[3]
		elseif (key(48) or btn(5)) and (#tongue > 3) then retreat()
	end
	
	if head.x+dir.x==neck.x and head.y+dir.y==neck.y then
		dir=last_dir
	end
end

-- States
function failstate()
	if((t/60==LEVELTIME) and (NUMANTS ~= 0) and (LIVES == 0)) then
		state=LOSESCREEN
	elseif ((t/60==LEVELTIME) and (NUMANTS ~= 0)) then
		LIVES = LIVES-1
		initialize()
		state=TRYAGAIN
	end
end

function tempWinState()
	if(NUMANTS==0) then
		state=WINSCREEN
	end
end

function checks()
	tongueUpdate()
	dirUpdate()
	gotFood()
	draw()
	failstate()
	tempWinState()
end

function retreatChecks()
	tongueUpdate()
	draw()
	failstate()
end

state=START

function TIC()
	if(state==INLEVEL) then
		t=t+1
		checks()
		print("Level: " .. (LEVEL+1), 192, 10, 3)
	elseif(state==RETREATING) then
		t=t+1
		retreatChecks()
		retreat()
		if(#tongue==3) then
			state=INLEVEL
		end
	elseif(state==TRYAGAIN) then
		map(30,0,31,17)
		print("Press Space or B to restart", 45, 20, 2) 
		if((key(48) or btn(5))) then
			state=INLEVEL
		end
	elseif(state==LOSESCREEN) then
		map(60,0,31,17)
		print("Press Space or B to quit", 45, 20, 2) 
		if((key(48) or btn(5))) then
			exit()
		end
	elseif(state==WINSCREEN) then
		map(90,0,31,17)
		print("Press Space or B for next level", 45, 20, 2) 
		if((key(48) or btn(5))) then
			LEVEL=LEVEL+1
			initialize()
			state=INLEVEL
		end
	elseif(state==START) then
		map(120,0,31,17)
		print("ARDY \n the \n AARDVARK", 70, 16, 2, 0, 3)
		print("Eat all the ants before time runs out", 16, 90, 1)
		print("Press Space or B to start", 48, 98, 3) 
		if((key(48) or btn(5))) then
			initialize()
		end
	end
end

